<template>
  <div :class="b()" class="d-flex j-center a-center flex-column">
    <div :class="b('image')" :style="imageStyle">
      <img :src="image" alt="">
    </div>
    <div :class="b('description')">{{desc}}</div>
    <slot></slot>
  </div>
</template>

<script>
import create from "core/create";
import props from "common/common/props.js";
import event from "common/common/event.js";
export default create({
  name: "empty",
  props: {
    size: {
      type: String
    },
    image: {
      type: String,
      default:
        'data:image/png;base64,'
    },
    imageSize: Number,
    desc: {
      type: String,
      default: ""
    }
  },
  computed: {
    imageStyle() {
      return {
        width: this.imageSize ? `${this.imageSize}px` : ''
      };
    }
  }
});
</script>

